import React from "react";
import './App.css';
import Header from './Header';
import Home from './Home';

function App() {
  return (

    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={
              [<Header />,<Home />]
            }>
          </Route>
          <Route path="/checkout" element={
              [<Header />]
            }>
          </Route>
        </Routes>
      </div>
    </Router>

  );
}

export default App;
